    /// <description>
    /// string : *spot markets only* 'buy' or 'sell' - the side of the orders to fetch
    /// </description>
    /// </item>
    /// <item>
    /// <term>params.fromOrderId</term>
    /// <description>
    /// string : *swap markets only* the id of the order to start from
    /// </description>
    /// </item>
    /// <item>
    /// <term>params.trigger</term>
    /// <description>
    /// bool : *swap markets only* the id of the order to start from true for fetching trigger orders (default false)
    /// </description>
    /// </item>
    /// <item>
    /// <term>params.stop</term>
    /// <description>
    /// bool : *swap markets only* the id of the order to start from an alternative for trigger param
    /// </description>
    /// </item>
    /// <item>
    /// <term>params.accountId</term>
    /// <description>
    /// string : account id to fetch the orders from
    /// </description>
    /// </item>
    /// </list>
    /// </remarks>
    /// <returns> <term>Order[]</term> a list of [order structures]{@link https://docs.ccxt.com/#/?id=order-structure}.</returns>
    public async Task<List<Order>> FetchCanceledAndClosedOrders(string symbol = null, Int64? since2 = 0, Int64? limit2 = 0, Dictionary<string, object> parameters = null)
    {
        var since = since2 == 0 ? null : (object)since2;
        var limit = limit2 == 0 ? null : (object)limit2;
        var res = await this.fetchCanceledAndClosedOrders(symbol, since, limit, parameters);
        return ((IList<object>)res).Select(item => new Order(item)).ToList<Order>();
    }
